              <div className="text-center">
                <h2>About Me</h2>
                <p className="mt-3">
                  Hello! I'm [Your Name], a passionate developer. Lorem ipsum dolor sit amet, consectetur adipiscing elit.
                  Nullam varius nisi ac elit feugiat, in hendrerit odio facilisis. Proin vel diam et elit accumsan laoreet.
                </p>
              </div>
            </div>
          </div>
        </div>
      );
};
export default About;
